  null,\n\t\"notes\": \"Parking regulations by blockface for the City of San Francisco.
  Includes the following regulations: Residential Parking Permits, Time limits, Government
  Permit, Metered, No overnight, Oversized Vehicle. Created through a mix of manual
  updates and data compilation. Updated as MTA Board resolutions are passed that impact
  parking regulations. Other critical information: This dataset has not been comprehesively
  updated. Dataset does not include color curb regulations such as loading zones or
  blue zones. Does not include detailed information for metered parking such as cap
  color or operating hours.\",\n\t\"owner_org\": \"e370c484-cc05-4509-919a-5600f8d56a48\",\n\t\"extras\":
